import React from "react";

import {initalPorjects} from "./data";
//photos

import "aos/dist/aos.css";
import Cards from "./Cards";

import {useState} from "react";

function Projects() {
  const [show, setShow] = useState(false);

  return (
    <div id="projects">
      <h1
        style={{
          padding: "0 0 2rem 0",
          color: "#5c99d6",
          letterSpacing: 6,
          marginTop: "1rem",
          fontSize: "2.7rem",
          textAlign: "center",
        }}
        data-aos="fade-down"
        data-aos-duration="1000"
        data-aos-offset="120"
      >
        Favorite Projects
      </h1>

      <div
        style={{
          textAlign: "center",
          display: "flex",
          justifyContent: "center",
          fontSize: "1.2rem",
          fontWeight: "700",
        }}
      >
        <div
          style={{
            textAlign: "center",
            display: "flex",
            justifyContent: "center",
          }}
          className="ui special cards "
        >
          <Cards
            name={"I regret"}
            liveWebsite={"https://regret1.herokuapp.com"}
            githubCode={"https://github.com/zaidalkhatib/Iregter"}
            description={
              "This website lets you post something you regret anonymously."
            }
            image={regret}
            language={"NodeJS"}
          />
          {initalPorjects.map((project) => (
            <Cards
              name={project.name}
              liveWebsite={project.liveWebsite}
              githubCode={project.githubCode}
              description={project.description}
              image={project.image}
              language={project.language}
            />
          ))}
          {show ? <></> : null}
        </div>
      </div>
      <div
        style={{
          display: "flex",
          flexDirection: "row",
          justifyContent: "center",
          paddingTop: "100px",
        }}
        data-aos="fade-up"
        data-aos-duration="1000"
        data-aos-offset="120"
      >
        <button
          className="ui  secondary submit button"
          onClick={() => {
            setShow(!show);
          }}
        >
          <p style={{letterSpacing: "2px", fontSize: "17px"}}>
            Show {show ? "Less" : "More"}
          </p>
        </button>
      </div>
    </div>
  );
}

export default Projects;
